import React from 'react'
import { Button } from '@mui/material'
import Icon from '@mui/material/Icon';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';
import SampleContextProvider from '../../context/SampleContext';
import NewItem from './NewItem'
import LsTable from './LsTable';


export default function LiveStock() {

    const [open, setOpen] = React.useState(false);
    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = (event, reason) => {
        setOpen(false);

    };

    return (
        <div>
            
            <LsTable />

            <Button onClick={handleClickOpen}>
                <Icon sx={{ fontSize: 30 }} color="primary">add_circle</Icon>
            </Button>
            <Dialog open={open} onClose={handleClose} maxWidth="lg" scroll="paper">
                <DialogTitle sx={{fontSize:24, fontWeight:'large'}}>New Item</DialogTitle>
                <DialogContent><SampleContextProvider>
                    <NewItem />
                </SampleContextProvider>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>DELETE</Button>
                    <Button onClick={handleClose}>CANCEL</Button>
                    <Button onClick={handleClose}>SAVE</Button>
                </DialogActions>
    </Dialog>

        </div>
    )
}
